        return (
<Row>
<Button block type="primary" shape="round" size={64}
style={{height:"60px",fontSize:"30px"}}
    onClick={this.onCreate}
    >
          ch1
        </Button>  
        <Button block type="primary" shape="round" size={64}
style={{height:"60px",fontSize:"30px"}}
    onClick={this.onCreate}
    >
          ch2
        </Button>  
        <Button block type="primary" shape="round" size={64}
style={{height:"60px",fontSize:"30px"}}
    onClick={this.onCreate}
    >
          ch3
        </Button>  
        <Button block type="primary" shape="round" size={64}
style={{height:"60px",fontSize:"30px"}}
    onClick={this.onCreate}
    >
          ch4
        </Button>    
</Row>
        )
    }
}

export default PlayQue
